INSERT INTO `brands` VALUES (4,'ZARA',NULL,'<p>Zara is a renowned global fashion brand that has become synonymous with contemporary style and accessibility. Established with a commitment to delivering the latest fashion trends at affordable prices, Zara has become a favorite destination for fashion enthusiasts worldwide.</p>\r\n\r\n<p>Known for its agile approach to fashion, Zara quickly adapts to emerging styles and customer preferences. The brand offers a diverse range of clothing and accessories, blending quality craftsmanship with on-trend designs. Zara&#39;s collections cater to a broad audience, providing a seamless blend of elegance and modernity.</p>\r\n\r\n<p>With a keen eye on innovation and a dedication to sustainability, Zara continues to redefine the fashion landscape. From chic casual wear to sophisticated formal attire, Zara remains at the forefront of the fashion industry, making style accessible to all.&quot;</p>\r\n\r\n<p>Feel free to customize and modify this description according to your specific requirements or to better align with the unique aspects of Zara that you want to highlight.</p>','/uploads/brands/17027410337173-zara.png',1,7,'2023-12-16 16:38:13','2023-12-16 15:43:28','2023-12-16 10:13:28'),(5,'ZARA',NULL,'<p>Zara is a renowned global fashion brand that has become synonymous with contemporary style and accessibility. Established with a commitment to delivering the latest fashion trends at affordable prices, Zara has become a favorite destination for fashion enthusiasts worldwide.</p>\r\n\r\n<p>Known for its agile approach to fashion, Zara quickly adapts to emerging styles and customer preferences. The brand offers a diverse range of clothing and accessories, blending quality craftsmanship with on-trend designs. Zara&#39;s collections cater to a broad audience, providing a seamless blend of elegance and modernity.</p>\r\n\r\n<p>With a keen eye on innovation and a dedication to sustainability, Zara continues to redefine the fashion landscape. From chic casual wear to sophisticated formal attire, Zara remains at the forefront of the fashion industry, making style accessible to all.</p>','/uploads/brands/17027449091372-zara.png',1,7,NULL,'2023-12-16 16:43:58','2023-12-16 11:13:58'),(6,'H&M',NULL,'<p>&nbsp;</p>\r\n\r\n<p>H&amp;M, or Hennes &amp; Mauritz, is a global fashion retailer known for its trendy and affordable clothing and accessories. Founded in 1947 in Sweden, H&amp;M has grown into one of the world&#39;s largest fashion retailers, with a presence in numerous countries.</p>','/uploads/brands/17027778445025-hm-logo.png',1,7,NULL,'2023-12-17 01:50:47','2023-12-16 20:20:47'),(7,'Internal Infrastructure Liaison',NULL,'<p>njjjjj</p>',NULL,1,7,'2023-12-17 04:46:21','2023-12-17 04:46:00','2023-12-16 23:16:00'),(8,'Regional Research Director',NULL,NULL,NULL,1,7,'2023-12-17 05:37:59','2023-12-17 05:09:53','2023-12-16 23:39:53'),(9,'Central Tactics Strategist',NULL,NULL,NULL,1,7,'2023-12-17 05:46:52','2023-12-17 05:44:46','2023-12-17 00:14:46'),(10,'Corporate Identity Agent',NULL,NULL,NULL,1,7,'2023-12-17 05:47:56','2023-12-17 05:45:23','2023-12-17 00:15:23'),(11,'Customer Metrics Strategist','customer-metrics-strategist-grd36z',NULL,NULL,1,7,'2023-12-17 05:47:00','2023-12-17 05:46:33','2023-12-17 00:16:33'),(12,'AA','aa-5rkJ6x',NULL,'/uploads/brands/17040361703113-screenshot-from-2023-12-17-10-46-46.png',1,7,NULL,'2023-12-31 15:22:55','2023-12-31 09:52:55');
